field_ps_descripcion:
  -
    value: "Gracias a la experiencia que tiene Findeter en el desarrollo de proyectos sostenibles que han generado crecimiento económico y social, la entidad presta la asesoría y el acompañamiento integral en el desarrollo y la ejecución de proyectos y programas de alto impacto.\r\n\r\nEs así como Findeter se ha consolidado como el aliado estratégico y el vehículo de ejecución de las políticas del Gobierno Nacional, en sectores como vivienda, agua e infraestructura social, entre otros.\r\n\r\nEsta asesoría incluye, según el convenio, el acompañamiento en términos técnicos, administrativos, legales y financieros."
